import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [],
    };
  }

  componentDidMount() {}

  render() {
    return (
      <div className="App">
        {this.state.monsters.map(function (niggles) {
          return (
            <div key={niggles.id}>
              <h1>{niggles.name}</h1>
            </div>
          );
        })}
      </div>
    );
  }
}

export default App;
